import "./job.css"
import React from 'react'

const Job = () => {
  return (
    <div className="job">
      <section>
        <div className="jobcontainer">
            <h1 className="jobname">Events</h1>
            <div className="jobs">
                {
                    c.map((card, i) => (

                        <div key={i} className="cardcard">
                            <h3 className="cardname">{card.title}</h3>
                            {/* <img className="piccard" src={card.pic} alt="" /> */}
                            <span className="ptext">{card.text}</span>
                            <button className="cardbtn">Explore</button>
                        </div>

                    ))
                }
                
            </div>

        </div>
      </section>
    </div>
  )
}

export default Job
